import styled from 'styled-components';
import useStats from "../utils/useStats";


const Landing = styled.div`
box-shadow: -8px -4px 8px 0px #ffffff, 8px 4px 12px 0px #d1d9e6, 4px 4px 4px 0px #d1d9e6 inset, -4px -4px 4px 0px #ffffff inset;    height: 100px;
    margin: 0 2rem 20px 2rem;
    padding: 28px 64px;
    border-radius: 30px;
    background-color: #e9e9e9;
`;

const Title = styled.h1`
  font-size: 2.4em;
  text-align: left;
  color: #ffee00;
`;

export default function Header() {
    return (
        <Landing>
            <Title>Corona Virus (Covid 19)</Title>
        </Landing>
    );
}
